              Power your business with our free restaurant online ordering
              system & you'll never have to worry about fees or commissions.
            </p>
          </div>
        </div>
        <div className="col-2">
          <img src={phone} alt="Phone with food" />
        </div>
      </div>
    );
  });
};

export default Row;
